import{_ as e,c as i,o,N as a}from"./chunks/framework.2ea5d489.js";const b=JSON.parse('{"title":"UAParser.js Changelog","description":"","frontmatter":{},"headers":[],"relativePath":"intro/whats-new.md","lastUpdated":1717860131000}'),r={name:"intro/whats-new.md"},l=a('<h1 id="uaparser-js-changelog" tabindex="-1">UAParser.js Changelog <a class="header-anchor" href="#uaparser-js-changelog" aria-label="Permalink to &quot;UAParser.js Changelog&quot;">​</a></h1><h2 id="version-2-0-0-beta-3" tabindex="-1">Version 2.0.0-beta.3 <a class="header-anchor" href="#version-2-0-0-beta-3" aria-label="Permalink to &quot;Version 2.0.0-beta.3&quot;">​</a></h2><ul><li>Breaking: <ul><li>AR/VR devices moved to new device type: <code>xr</code></li><li>New property in <code>browser</code>: <code>type</code></li></ul></li><li>New features: <ul><li>Parse directly from command line using <code>npx ua-parser-js</code></li><li>Extensions can be passed as a list to <code>UAParser()</code></li></ul></li><li>Add new browser: Pico Browser, Twitter, Wolvic</li><li>Improve browser detection: DuckDuckGo, ICEBrowser, Klar, QQ, Sleipnir</li><li>Improve device detection: Oculus Quest &amp; Oppo Pad</li><li>Update latest client hints spec: <code>formFactor</code> -&gt; <code>formFactors</code></li><li>In <code>ua-parser-js/extensions</code> submodule, <code>bots</code> divided into <code>crawler</code> / <code>fetcher</code></li></ul><h2 id="version-2-0-0-beta-2" tabindex="-1">Version 2.0.0-beta.2 <a class="header-anchor" href="#version-2-0-0-beta-2" aria-label="Permalink to &quot;Version 2.0.0-beta.2&quot;">​</a></h2><ul><li>Increase UA_MAX_LENGTH to 500</li><li>Add TypeScript declaration file in <code>ua-parser-js/extensions</code> submodule</li><li>Improve TypeScript module resolution</li><li>Add new methods in <code>ua-parser-js/helpers</code> submodule: <code>isAppleSilicon()</code> &amp; <code>isChromiumBased()</code></li><li>Fix misidentified WebView token as device model</li><li>Add new browser: Alipay, Klarna, Opera GX, Smart Lenovo Browser, Vivo Browser</li><li>Rename browser: Avant, Baidu, Samsung Internet, Sogou Explorer, Sogou Mobile, WeChat</li><li>Improve client-hints detection: Edge, Xbox</li></ul><h2 id="version-2-0-0-beta-1" tabindex="-1">Version 2.0.0-beta.1 <a class="header-anchor" href="#version-2-0-0-beta-1" aria-label="Permalink to &quot;Version 2.0.0-beta.1&quot;">​</a></h2><ul><li>Update Client Hints Form-Factor</li><li>Provide in-package type definitions</li><li>Add new device: Ulefone</li><li>Improve device detection: Realme, Xiaomi Redmi</li></ul><h2 id="version-2-0-0-alpha-3" tabindex="-1">Version 2.0.0-alpha.3 <a class="header-anchor" href="#version-2-0-0-alpha-3" aria-label="Permalink to &quot;Version 2.0.0-alpha.3&quot;">​</a></h2><ul><li>Add <code>withFeatureCheck()</code> method</li><li>Add <code>isFrozenUA()</code> method in <code>ua-parser-js/helpers</code> submodule</li><li>Add <code>MediaPlayers</code> &amp; <code>Modules</code> in <code>ua-parser-js/extensions</code> submodule</li><li>Fix issue with ESM import</li></ul><h2 id="version-2-0-0-alpha-2" tabindex="-1">Version 2.0.0-alpha.2 <a class="header-anchor" href="#version-2-0-0-alpha-2" aria-label="Permalink to &quot;Version 2.0.0-alpha.2&quot;">​</a></h2><ul><li>Fix browser result always returning Chromium when using withClientHints()</li><li>Fix infinite-loop when await-ing withClientHints() in non-client-hints browser</li></ul><h2 id="version-2-0-0-alpha-1" tabindex="-1">Version 2.0.0-alpha.1 <a class="header-anchor" href="#version-2-0-0-alpha-1" aria-label="Permalink to &quot;Version 2.0.0-alpha.1&quot;">​</a></h2><ul><li>Initial work on new major version</li></ul><h2 id="version-2-0" tabindex="-1">Version 2.0 <a class="header-anchor" href="#version-2-0" aria-label="Permalink to &quot;Version 2.0&quot;">​</a></h2><ul><li>What&#39;s breaking: <ul><li>Dual-licensed under AGPLv3 or PRO License</li><li>Browser detection on mobile device: <code>&quot;Chrome&quot; =&gt; &quot;Mobile Chrome&quot;</code>, <code>&quot;Firefox&quot; =&gt; &quot;Mobile Firefox&quot;</code></li><li>OS detection: <code>&quot;Mac OS&quot; =&gt; &quot;macOS&quot;</code>, <code>&quot;Chromium OS&quot; =&gt; &quot;Chrome OS&quot;</code></li><li>AR/VR devices moved to new device type: <code>xr</code></li><li>New property in <code>browser</code>: <code>type</code></li></ul></li><li>What&#39;s new: <ul><li>Some new methods in result object: <ul><li>Support for client hints: <code>withClientHints()</code></li><li>Support for feature detection: <code>withFeatureCheck()</code></li><li>Utility for easy comparison: <code>is()</code></li><li>Utility to print full-name: <code>toString()</code></li></ul></li><li>Parse directly from command line using <code>npx ua-parser-js</code></li><li>Extensions can be passed as a list to <code>UAParser()</code></li><li>Support for ES module <code>import { UAParser } from &#39;ua-parser-js&#39;</code></li><li>Provided Enums submodule <code>&#39;ua-parser-js/enums&#39;</code></li><li>Provided Extensions submodule <code>&#39;ua-parser-js/extensions&#39;</code></li><li>Provided Helpers submodule <code>&#39;ua-parser-js/helpers&#39;</code></li></ul></li></ul><hr><h2 id="version-0-7-38-1-0-38" tabindex="-1">Version 0.7.38 / 1.0.38 <a class="header-anchor" href="#version-0-7-38-1-0-38" aria-label="Permalink to &quot;Version 0.7.38 / 1.0.38&quot;">​</a></h2><ul><li>Fix error on getOS() when userAgentData.platform is undefined</li><li>Add new browser: Opera GX, Twitter</li><li>Improve browser detection: DuckDuckGo</li><li>Improve device detection: OPPO Pad, Oculus Quest</li></ul><h2 id="version-0-7-37-1-0-37" tabindex="-1">Version 0.7.37 / 1.0.37 <a class="header-anchor" href="#version-0-7-37-1-0-37" aria-label="Permalink to &quot;Version 0.7.37 / 1.0.37&quot;">​</a></h2><ul><li>Fix misidentified WebView token as device model</li><li>Increase UA_MAX_LENGTH to 500</li><li>Add new browser: Alipay, Klarna, Smart Lenovo Browser, Vivo Browser</li><li>Add new device: Ulefone</li><li>Improve device detection: Realme, Xiaomi Redmi</li><li>Rename browser: Avant, Baidu, Samsung Internet, Sogou Explorer, Sogou Mobile, WeChat</li></ul><h2 id="version-0-7-36-1-0-36" tabindex="-1">Version 0.7.36 / 1.0.36 <a class="header-anchor" href="#version-0-7-36-1-0-36" aria-label="Permalink to &quot;Version 0.7.36 / 1.0.36&quot;">​</a></h2><ul><li>Add new browser: Snapchat</li><li>Add new devices: Infinix, Tecno</li><li>Improve device detection: Amazon Fire TV, Xiaomi POCO</li><li>Improve OS detection: iOS</li></ul><h2 id="version-0-7-35-1-0-35" tabindex="-1">Version 0.7.35 / 1.0.35 <a class="header-anchor" href="#version-0-7-35-1-0-35" aria-label="Permalink to &quot;Version 0.7.35 / 1.0.35&quot;">​</a></h2><ul><li>Fix result from user-supplied user-agent being altered</li><li>Add new browser: Heytap, TikTok</li><li>Add new engine: LibWeb</li><li>Add new OS: SerenityOS</li><li>Improve browser detection: Yandex</li><li>Improve device detection: iPhone, Amazon Echo</li><li>Improve OS detection: iOS</li></ul><h2 id="version-0-7-34-1-0-34" tabindex="-1">Version 0.7.34 / 1.0.34 <a class="header-anchor" href="#version-0-7-34-1-0-34" aria-label="Permalink to &quot;Version 0.7.34 / 1.0.34&quot;">​</a></h2><ul><li>Fix Sharp Mobile detected as Huawei Tablet</li><li>Fix IE8 bug</li><li>Add new devices : Kobo e-Reader, Apple Watch, and some new SmartTV devices</li><li>Add new OS : watchOS</li><li>Improve browser detection : Kakao, Naver, Brave</li><li>Improve device detection : Oculus, iPad</li><li>Improve OS detection : Chrome OS</li><li>Using navigator.userAgentData as fallback for device.type &amp; os.name</li></ul><h2 id="version-0-7-33-1-0-33" tabindex="-1">Version 0.7.33 / 1.0.33 <a class="header-anchor" href="#version-0-7-33-1-0-33" aria-label="Permalink to &quot;Version 0.7.33 / 1.0.33&quot;">​</a></h2><ul><li>Add new browser : Cobalt</li><li>Identify Macintosh as an Apple device</li><li>Fix ReDoS vulnerability</li></ul><h2 id="version-0-7-32-1-0-32" tabindex="-1">Version 0.7.32 / 1.0.32 <a class="header-anchor" href="#version-0-7-32-1-0-32" aria-label="Permalink to &quot;Version 0.7.32 / 1.0.32&quot;">​</a></h2><ul><li>Add new browser : DuckDuckGo, Huawei Browser, LinkedIn</li><li>Add new OS : HarmonyOS</li><li>Add some Huawei models</li><li>Add Sharp Aquos TV</li><li>Improve detection Xiaomi Mi CC9</li><li>Fix Sony Xperia 1 III misidentified as Acer tablet</li><li>Fix Detect Sony BRAVIA as SmartTV</li><li>Fix Detect Xiaomi Mi TV as SmartTV</li><li>Fix Detect Galaxy Tab S8 as tablet</li><li>Fix WeGame mistakenly identified as WeChat</li><li>Fix included commas in Safari / Mobile Safari version</li><li>Increase UA_MAX_LENGTH to 350</li></ul><h2 id="version-0-7-31-1-0-2" tabindex="-1">Version 0.7.31 / 1.0.2 <a class="header-anchor" href="#version-0-7-31-1-0-2" aria-label="Permalink to &quot;Version 0.7.31 / 1.0.2&quot;">​</a></h2><ul><li>Fix OPPO Reno A5 incorrect detection</li><li>Fix TypeError Bug</li><li>Use AST to extract regexes and verify them with safe-regex</li></ul><h2 id="version-0-7-30-1-0-1" tabindex="-1">Version 0.7.30 / 1.0.1 <a class="header-anchor" href="#version-0-7-30-1-0-1" aria-label="Permalink to &quot;Version 0.7.30 / 1.0.1&quot;">​</a></h2><ul><li>Add new browser : Obigo, UP.Browser, Klar</li><li>Add new device : Oculus, Roku</li><li>Add new OS: Maemo, HP-UX, Android-x86, Deepin, elementary OS, GhostBSD, Linspire, Manjaro, Sabayon</li><li>Improve detection for Sony Xperia 1ii, LG Android TV, and some more devices</li><li>Improve detection for ARM64 CPU</li><li>Improve detection for Windows Mobile, Netscape, Mac on PowerPC</li><li>Categorize PDA as mobile</li><li>Fix Sharp devices misjudged as Huawei</li><li>Fix trailing comma for ES3 compatibility</li><li>Some code refactor</li></ul><h2 id="version-0-7-1-0" tabindex="-1">Version 0.7 / 1.0 <a class="header-anchor" href="#version-0-7-1-0" aria-label="Permalink to &quot;Version 0.7 / 1.0&quot;">​</a></h2><p>Version 1.0.x is basically the equivalent of version 0.7.x (mirror/duplicate). See <a href="https://github.com/faisalman/ua-parser-js/issues/536" target="_blank" rel="noreferrer">#536</a> for the reason behind this confusion.</p><h2 id="version-0-8" tabindex="-1">Version 0.8 <a class="header-anchor" href="#version-0-8" aria-label="Permalink to &quot;Version 0.8&quot;">​</a></h2><p>Version 0.8 was created by accident. This version is now deprecated and no longer maintained, please update to version 0.7 / 1.0.</p>',38),n=[l];function t(s,d,c,u,h,m){return o(),i("div",null,n)}const v=e(r,[["render",t]]);export{b as __pageData,v as default};
